import React from 'react';
import { useTodoState } from '../hooks/useTodoState';

function TodoList() {
  const { todos, deleteTodo } = useTodoState();

  return (
    <ul>
      {todos.map((todo, index) => (
        <li key={index}>
          {todo}
          <button onClick={() => deleteTodo(index)}>Delete</button>
        </li>
      ))}
    </ul>
  );
}

export default TodoList;
